// Sam.js (Updated with different row colors)
import React, { useRef, useEffect, useState } from 'react';
import styled, { css } from 'styled-components';

// --- 1. CONFIGURATION AND DATA ---

// Define different colors for each row (Req. New)
const ROW_COLORS = [
    '#0e0d0d', // Dark Black (Base)
    '#250c0c', // Dark Red/Brown
    '#0c251e', // Dark Teal/Green
    '#25240c', // Dark Yellow/Mustard
    '#0c1525', // Dark Blue
    '#250c25', // Dark Purple
];

// Dummy Image URLs (for demonstration)
const dummyImage = "https://via.placeholder.com/600x800.png?text=Image";
const images = [
  `${dummyImage}+01`,
  `${dummyImage}+02`,
  `${dummyImage}+03`,
  `${dummyImage}+04`,
  `${dummyImage}+05`,
  `${dummyImage}+06`,
];

const content = [
  { id: 1, number: '01', image: images[0], color: ROW_COLORS[0] },
  { id: 2, number: '02', image: images[1], color: ROW_COLORS[1] },
  { id: 3, number: '03', image: images[2], color: ROW_COLORS[2] },
  { id: 4, number: '04', image: images[3], color: ROW_COLORS[3] },
  { id: 5, number: '05', image: images[4], color: ROW_COLORS[4] },
  { id: 6, number: '06', image: images[5], color: ROW_COLORS[5] },
];

// --- 2. STYLED COMPONENTS (CSS-in-JS) ---

// Global body styles (Req. 9)
const GlobalStyle = css`
  body {
    /* Use the first color as the default background */
    background-color: ${ROW_COLORS[0]}; 
    color: white;
    margin: 0;
    padding: 0;
  }
`;

// Main Container
const SamContainer = styled.div`
  ${GlobalStyle}
  display: block;
  width: 100%;
`;

// Row Styling (UPDATED to accept a background color prop)
const SamRow = styled.div`
  display: flex;
  height: 100vh; 
  width: 100%;
  /* Apply the background color dynamically */
  background-color: ${props => props.$bgColor || 'black'}; 
`;

// Column Base Styling
const SamCol = styled.div`
  display: flex; 
  align-items: center;
  justify-content: center;
`;

// Left Column (Req. 1, 8, 10, 11)
const LeftCol = styled(SamCol)`
  flex: 0 0 40%; 
  position: relative; 
  overflow: hidden; 
  /* Req. 8 & 9 */
  border-top: 1px solid white;
  border-bottom: 1px solid white; 
`;

// Right Column (Req. 1, 4, 7)
const RightCol = styled(SamCol)`
  flex: 0 0 60%; 
  
`;

// Image Styling (Req. 4)
const RowImage = styled.img`
  max-width: 80%;
  max-height: 80%;
  object-fit: contain;
`;

// Number Wrapper (Req. 3, 5, 11)
const NumberWrapper = styled.div`
  position: absolute; 
  top: 50%;
  right: 5%; 
  
  font-size: 5rem;
  font-weight: bold;
  color: #444; 
  transition: color 0.3s ease;
  
  opacity: 0;
  transform: translate(0, 100vh); 

  ${props => props.$isSticky && css`
    position: fixed; 
    top: 50%;
    right: 5%; 
    transform: translateY(-50%);
    
    color: white; 
    opacity: 1;
    
    transition: opacity 0.3s, color 0.3s;
  `}
`;

// --- 3. React Component Logic ---

const Sam = () => {
  const [activeNumberId, setActiveNumberId] = useState(1);
  const rowRefs = useRef([]);

  useEffect(() => {
    // Intersection Observer Configuration
    const observerOptions = {
      root: null, 
      // Targets the middle 10% of the viewport (45% to 55%)
      rootMargin: '-45% 0px -45% 0px', 
      threshold: 0, 
    };

    const observer = new IntersectionObserver((entries) => {
      entries.forEach(entry => {
        const rowId = parseInt(entry.target.dataset.id);
        
        if (entry.isIntersecting) {
          setActiveNumberId(rowId);
        }
      });
    }, observerOptions);

    rowRefs.current.forEach(ref => {
      if (ref) observer.observe(ref);
    });

    return () => {
      rowRefs.current.forEach(ref => {
        if (ref) observer.unobserve(ref);
      });
    };
  }, []);

  return (
    <SamContainer>
      {content.map((item, index) => (
        <SamRow
          key={item.id}
          ref={el => rowRefs.current[index] = el}
          data-id={item.id}
          // Pass the unique color using the $bgColor prop
          $bgColor={item.color} 
        >
          {/* Left Column (Sticky Number) */}
          <LeftCol 
            // Setting z-index dynamically (Req. 6)
            style={{ zIndex: 6 - index }} 
          >
            <NumberWrapper 
                $isSticky={activeNumberId === item.id}
            >
                {item.number}
            </NumberWrapper>
          </LeftCol>

          {/* Right Column (Image) (Req. 7) */}
          <RightCol>
            <RowImage src={item.image} alt={`Content ${item.number}`} />
          </RightCol>
        </SamRow>
      ))}
    </SamContainer>
  );
};

export default Sam;
